function Button (){
        
    return (
        
<Popup trigger={<button className="button"> Open Modal </button>} modal>
    <form>
    <form>
  <label>
    Name:
    <input type="text" name="name" />
  </label>
  <input type="submit" value="Submit" />
</form>
    </form>
  </Popup>
  
    );
}


export default Button;
